const bitBucketPopup = `
<div id="commentator---bitbucket-integration---suggestions-container">
    <label for="commentator---bitbucket-integration---suggestions"> </label>
    <textarea id="commentator---bitbucket-integration---suggestions" readonly></textarea>
    <div id="commentator---bitbucket-integration---buttons-container">
        <button id="commentator---bitbucket-integration---respectify-button">Respectify </button>
        <img width="35" height="35" id="commentator---bitbucket-integration---replace-button" src="https://img.icons8.com/plasticine/100/replace.png" alt="replace"/>
    </div>
</div>
`
const characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789 ';

function generateString(length) {
    let result = ' ';
    const charactersLength = characters.length;
    for (let i = 0; i < length; i++) {
        result += characters.charAt(Math.floor(Math.random() * charactersLength));
    }

    return result;
}

function getBitBucketIntegrationPopupContainer(svgContainer) {
    return svgContainer.parentElement.parentElement
}


function setupPopup(bitBucketIntegrationPopUp, svgContainer, content) {
    bitBucketIntegrationPopUp.addEventListener('click', (e) => e.stopPropagation())
    const textarea = bitBucketIntegrationPopUp.querySelector("#commentator---bitbucket-integration---suggestions")
    const replaceButton = bitBucketIntegrationPopUp.querySelector("#commentator---bitbucket-integration---replace-button")
    const submitButton = bitBucketIntegrationPopUp.querySelector("#commentator---bitbucket-integration---respectify-button")
    replaceButton.addEventListener('click', () => {
        //TODO call API
        textarea.innerHTML = generateString(Math.random() > 0.5 ? 30 : 300)
    })
    textarea.addEventListener('DOMSubtreeModified', () => updateTextareaSize(textarea))

    setTimeout(() => textarea.innerHTML = content, 10)

    submitButton.addEventListener('click', () => {
        const editorElement = getBitBucketIntegrationPopupContainer(svgContainer)
        const allParagraphs = Array.from(getAllParagraphsFromEditor(editorElement))
        const allSpans = allParagraphs.map(p => Array.from(p.childNodes).filter(child => child?.tagName?.toLowerCase() ?? "" === "span"))
        const paragraphsContainer = allParagraphs[0].parentElement
        allParagraphs.forEach(p => p.remove())
        const newParagraphs = textarea.innerHTML.split('\n').map((pContent) => {
            const newElement = document.createElement('p')
            newElement.innerText = pContent
            return newElement
        })

        newParagraphs.map(p => paragraphsContainer.appendChild(p))
        if (allSpans.length > 0) {
            const spansP = document.createElement("p")
            allSpans.forEach(spans => spans.forEach(span => spansP.appendChild(span)))
            paragraphsContainer.appendChild(spansP)
        }
    })

}

function getAllParagraphsFromEditor(editorElement) {
    return editorElement.querySelectorAll(".ak-editor-content-area p")
}

function addBitBucketIntegrationPopup(svgContainer, content) {
    console.log("commentator - click occurred")
    const bitBucketContainer = document.createElement('div')
    bitBucketContainer.innerHTML = bitBucketPopup
    setupPopup(bitBucketContainer, svgContainer, content);

    getBitBucketIntegrationPopupContainer(svgContainer).appendChild(bitBucketContainer)
}

function getParagraphElementTextOnly(element) {
    const textToConcatenate = []
    element.childNodes.forEach((node) => {
        if (node.nodeType === Node.TEXT_NODE) {
            textToConcatenate.push(node.textContent.trim())
        }
    })
    return textToConcatenate.join(" ");
}

function removeIntegrationPopUp(svgContainer) {
    const previousElement = getBitBucketIntegrationPopupContainer(svgContainer).querySelector("#commentator---bitbucket-integration---suggestions-container")
    if (previousElement) {
        previousElement.parentElement.remove()
        return true
    }
    return false
}

function addIconToEditor(editorElement) {
    const svgContainer = document.createElement("div");
    svgContainer.id = "commentator---bitbucket-integration---icon-container"
    svgContainer.innerHTML = icon
    editorElement.appendChild(svgContainer)
    svgContainer.addEventListener('click', () => {
        if (removeIntegrationPopUp(svgContainer)) {
            console.log("pop up already was opened, just removing")
            return
        }
        const editorElement = getBitBucketIntegrationPopupContainer(svgContainer)
        const allParagraphs = getAllParagraphsFromEditor(editorElement)
        const content = Array.from(allParagraphs).map(element => getParagraphElementTextOnly(element)).join('\n')
        //TODO call API.
        addBitBucketIntegrationPopup(svgContainer, `Respectified: \n${content}`)
    })
}

function integrateWithEditor(element) {
    element.classList.add("commentator---bitbucket-integration")
    addIconToEditor(element)
    if (!window.commentatorEditorElementsBitBucketIntegration) {
        window.commentatorEditorElementsBitBucketIntegration = []
    }
    window.commentatorEditorElementsBitBucketIntegration.push(element)
}

function updateTextareaSize(textareaElement) {
    console.log("updateTextareaSize called")
    textareaElement.style.height = 'auto'; // Reset height to auto
    textareaElement.style.height = (textareaElement.scrollHeight) + 'px'; // Set to the scroll height
}


function observeEditorsInBitBucket() {
// Callback function to be executed when the element is found
    const mutationCallback = function (mutationsList, observer) {
        for (const mutation of mutationsList) {
            if (mutation.type === 'childList' && mutation.addedNodes.length > 0 && document.querySelectorAll(".akEditor:not([class*='commentator---bitbucket-integration'])").length > 0) {
                const allEditors = document.querySelectorAll(".akEditor:not([class*='commentator---bitbucket-integration'])")
                allEditors.forEach(editor => integrateWithEditor(editor))
                console.log(`commentator - num of editors are ${allEditors.length}`)
            }
        }
    };

// Create a MutationObserver with the callback function
    const observer = new MutationObserver(mutationCallback);

// Configure and start observing the target element
    const observerConfig = {childList: true, subtree: true};
// Target element to observe
    observer.observe(document, observerConfig);
}

console.log("commentator - script loaded")
observeEditorsInBitBucket()